import React from "react";
import "./App.css";

import Profile from "./components/Profile/Profile";
import Header from "./components/Header/Header";
import Nav from "./components/Navbar/Nav";
import Dialogs from "./components/Dialogs/Dialogs";
import { BrowserRouter, Route } from "react-router-dom";
import Music from "./components/Music/Music";
import News from "./components/News/News";
import Setting from "./components/Setting/Setting";

const App = (props) => {

  let postData = [
    { message: "hi", id: 1, likes: "15" },
    { message: "how is your name", id: 1, likes: "15" },
    { message: "what are you doing", id: 1, likes: "15" },
  ];

  let dialogsData = [
    { id: 1, name: "Eugene" },
    { id: 2, name: "Sasha" },
    { id: 3, name: "Igor" },
    { id: 4, name: "lex" },
    { id: 5, name: "Ilya" },
  ];

  let messageData = [
    { say: "hi", id: 1 },
    { say: "how is your name", id: 2 },
    { say: "what are you doing", id: 3 },
  ];

  return (
    <BrowserRouter>
      <div className="app__wrapper">
        <Header />
        <Nav />
        <div className="app__wrapper-content">
          <Route path="/profile" render={() => <Profile posts={postData}/>} />
          <Route path="/dialogs" render={() => <Dialogs dialogs={dialogsData} />} />
          <Route path="/music" render={() => <Music />} />
          <Route path="/news" component={() => <News />} />
          <Route path="/setting" component={() => <Setting />} />
        </div>
      </div>
    </BrowserRouter>
  );
};

export default App;
